import React from 'react';
import './LastThreeNotes.css'

const TileComponent = ({ title, description, updatedAt }) => (
  <div className="tile">
    <h3>{title}</h3>
    <p>{description}</p>
    <p>Last Updated: {updatedAt}</p>
  </div>
);

const TilesContainer = ({ notes }) => {
    console.log('Received notes:', notes); 
  
    return (
      <div id="tiles-container">
        {notes.map((note) => (
          <TileComponent key={note._id} {...note} />
        ))}
      </div>
    );
  };
  

export default TilesContainer;
